import { Avatar } from "@mui/material";
import React from "react";
import { useContext } from "react";
import { LoginContext } from "./Context/Context";
import "./header.css";
import Menu from "@mui/material/Menu";
import MenuItem from "@mui/material/MenuItem";

const Navbar = () => {
	const { loginData} = useContext(LoginContext);
	console.log("Hey", loginData);
	return (
		<header>
			<nav>
				<h1>Welcome to My Site</h1>
				<div className="avtar">{loginData?.name ? <Avatar style={{ background: "salmon", fontWeight: "bold", textTransform: "capitalize" }}>{loginData.name[0].toUpperCase()} </Avatar> : <Avatar style={{ background: "gray" }} />}</div>
			</nav>
		</header>
	);
};

export default Navbar;
